import React from 'react';
import styles from './elementItem.css';

const ElementItem = ({ dragging, name, className = '', isShadowElement = false }) => {
  return (
    <div
      className={`${styles.ElementItem} ${dragging ? styles.dragging : ''} ${className}`}
      style={{ opacity: dragging && !isShadowElement ? 0.5 : 1 }}
    >
      {name}
    </div>
  );
};

export default ElementItem;
